function App() {
  return (
    <BrowserRouter>
      <Nav />
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='/dogs' element={<DogIndex />} />
        <Route path='/dogs/:point' element={<DogShow />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  );
}

export default App;

